package ru.notivent.service.yandex.s3;

import static org.junit.jupiter.api.Assertions.*;

import java.util.HashMap;
import java.util.UUID;
import org.junit.jupiter.api.AfterAll;
import org.junit.jupiter.api.BeforeAll;
import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.test.context.ActiveProfiles;
import org.springframework.test.context.TestPropertySource;
import org.testcontainers.containers.localstack.LocalStackContainer;
import org.testcontainers.junit.jupiter.Testcontainers;
import org.testcontainers.utility.DockerImageName;
import software.amazon.awssdk.auth.credentials.AwsBasicCredentials;
import software.amazon.awssdk.auth.credentials.StaticCredentialsProvider;
import software.amazon.awssdk.regions.Region;
import software.amazon.awssdk.services.s3.model.CreateBucketRequest;

@Testcontainers
@SpringBootTest
@ActiveProfiles("test")
@TestPropertySource(locations = "classpath:application-test.yaml")
class S3ServiceTest {

  static DockerImageName localstackImage = DockerImageName.parse("localstack/localstack:0.14.0");

  static LocalStackContainer localStackContainer =
      new LocalStackContainer(localstackImage).withServices(LocalStackContainer.Service.S3);

  final String ACCESS_KEY = "test";
  final String SECRET_KEY = "test";
  final Region region = Region.US_EAST_1;
  private static final String IMAGES_BUCKET = "geopoint-images";

  @BeforeAll
  static void beforeAll() {
    localStackContainer.start();
  }

  @AfterAll
  static void afterAll() {
    localStackContainer.stop();
  }

  @Autowired S3Service s3Service;

  @Test
  void saveImages() {
    var images = new HashMap<String, String>();
    images.put(
        "",
        ".jpg");
    var s3Client =
        software.amazon.awssdk.services.s3.S3Client.builder()
            .endpointOverride(
                localStackContainer.getEndpointOverride(LocalStackContainer.Service.S3))
            .credentialsProvider(
                StaticCredentialsProvider.create(
                    AwsBasicCredentials.create(ACCESS_KEY, SECRET_KEY)))
            .region(region)
            .build();
    var client = new ClientS3(s3Client);
    var request = CreateBucketRequest.builder().bucket(IMAGES_BUCKET).build();
    client.getClient().createBucket(request);

    var result = s3Service.saveImages(images, UUID.randomUUID(), UUID.randomUUID(), client);

    assertFalse(result.isEmpty());
  }
}
